  \"2016-05-25T00:43:05.772999\",\n\t\"name\": \"monthly-motor-fuel-monthly-motor-fuel-reports-335bc\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"On a monthly basis, each State is required
  to report to the Federal Highway Administration (FHWA), the amount of gallons taxed
  by that state. This data is analyzed and compiled by FHWA staff. The data on the
  amount of on-highway fuel use for each State is then used to attribute federal revenue
  to each State. Yearly, the FHWA, Office of Policy, provides data from the previous
  year's data for use in the attribution process. The previous year data is used to
  provide States added time to review, allowing them to verify that the data report
  is correct and ready to be used in attribution.\",\n\t\"license_title\": \"Other
